	add $9, $0, $22 	# base (colunas do desenho)
	add $10, $0, $23 	# altura (linhas do desenho)
	add $11, $0, $18 	# x do canto superior esquerdo
	add $12, $0, $19 	# y do canto superior esquerdo
	jal carregafundo
	

# controle:	
controle:
	lui $8, 0xffff
	lw $11, 0($8)
	beq $11, $0, naodig
	addi $12, $0, 'd'
	lw $13, 4($8) 		# tecla
	beq $12, $13, dir 	# d 
	addi $12, $0, 'a'
	beq $12, $13, esq 	# a
	addi $12, $0, 's'
	beq $12, $13, baixo 	# s
	addi $12, $0, 'w'
	beq $12, $13, cima 	# w 
	addi $12, $0, ' '
	beq $12, $13, end 	# ' '
	j naodig

dir:  	
	addi $18, $18, 3 	# vai pra direita
	j naodig
esq: 	
	addi $18, $18, -3 	# vai pra esquerda
	j naodig
baixo: 	
	#addi $19, $19, 3 # vai pra baixo 
	j naodig
cima:	
	#addi $19, $19, -3 # vai pra cima
	j naodig
	
naodig:
	#o que acontece quando nada acontece: nada

fimpers1:
	
# armazena caracteristicas do inimigo
	sw $22 0($2) 		# base  
	sw $23 4($2) 		# altura 
	sw $18 8($2) 		# x inicial
	sw $19 12($2) 		# y inicial
	sw $20 16($2) 		# x final
	sw $21 20($2) 		# y final
	sw $28 24($2) 		# inicio
	sw $29 28($2) 		# extra
	
pers2:

# carregamento inimigo
	lw $22 0($3) 		# base  
	lw $23 4($3) 		# altura 
	lw $18 8($3) 		# x inicial
	lw $19 12($3)		# y inicial
	lw $20 16($3) 		# x final
	lw $21 20($3) 		# y final
	lw $28 24($3) 		# inicio
	lw $29 28($3) 		# extra
	
# apagar inimigo
	add $9, $0, $22 	# base (colunas do desenho)
	add $10, $0, $23 	# altura (linhas do desenho)
	add $11, $0, $18 	# x do canto superior esquerdo
	add $12, $0, $19 	# y do canto superior esquerdo
	jal carregafundo
	
# mov auto
ida2:	beq $18, $20 troca2 	# troca x inicial e final
	bgt $18, $20 volta2 	# loop da ida
	addi $18, $18, 1 	# variacao do movimento
	j fimpers2
troca2:
	add $20 $0 $29 		# x final = x inicial
	add $29 $0 $18 		# extra = x final
	j fimpers2
volta2:	
	blt $18 $20 ida2 	# loop da volta
	addi $18, $18, -1 	# variacao do movimento
fimpers2:
	
# guarda caracteristicas do amigo
	sw $22 0($3) 		# base  
	sw $23 4($3) 		# altura 
	sw $18 8($3) 		# x inicial
	sw $19 12($3) 		# y inicial
	sw $20 16($3) 		# x final
	sw $21 20($3) 		# y final
	sw $28 24($3) 		# inicio
	sw $29 28($3) 		# extra
	
	j animacao

fimanimacao:

	
end:
	addi $2, $0, 10
	syscall
	
# carregar cenario
load:	
	lw $9, 0($24)
	sw $9, 0($8)
	addi $8, $8, 4
	addi $24, $24, 4
	addi $10, $10, 1
	bne $10, $26, load
	jr $31
	
# guarda cenario e personagem na memoria
store:
	lw $9, 0($8)
	sw $9, 0($24)
	addi $8, $8, -4
	addi $24, $24, -4
	addi $10, $10, -1
	bne $10, 0, store
	jr $31

# desenha personagem
personagem:  
	lui $15, 0x1001
	sll $11, $11, 2 	# onde vai percorrer no eixo x
	div $6 $7 		# width-proporcao
	mflo $1
	sll $1 $1 2 		# onde vai percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 	# posicao inicial de comecar a desenhar
	add $13, $0, $9 	# colunas
laco1:	beq $10, $0, fimlaco1
laco2:	beq $9, $0, fimlaco2
	lw $14, 0($8) 		# onde vai ler
	sw $14, 0($15) 		# onde vai desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 	# colunas
	j laco2
fimlaco2:   
	div $6 $7 		# width-proporcao
	mflo $1
	sll $1 $1 2 		# onde vai percorrer no eixo y
	add $15, $15, $1
	sll $16, $13, 2 
	sub $15, $15, $16 	# volta para a coluna inicial
	add $9, $0, $13 	# valor inicial de colunas 
	addi $10, $10, -1 	# linhas 
	j laco1  
fimlaco1: 
	jr $31
            
# carrega parte do cenario
carregafundo:  
	lui $15, 0x1001
	sll $11, $11, 2 	# onde vai percorrer no eixo x
	div $6 $7 		# width-proporcao
	mflo $1
	sll $1 $1 2 		# onde vai percorrer no eixo y
	mul $12, $12, $1 
	add $15, $15, $11
	add $15, $15, $12 	# posicao inicial de comecar a desenhar
	add $13, $0, $9 	# colunas        
	lui $8, 0x1001 
	add $8, $8, $11
	add $8, $8, $12 	# posicao inicial de comecar a desenhar
	add $12, $0, $26
	sll $12, $12, 2
	add $8, $8, $12
	    
laco1.1:
	beq $10, $0, fimlaco1.1
laco2.1:
	beq $9, $0, fimlaco2.1
	lw $14, 0($8) 		# onde vai ler
	sw $14, 0($15) 		# onde vai desenhar.
	addi $8, $8, 4 
	addi $15, $15, 4
	addi $9, $9, -1 	# colunas
	j laco2.1
fimlaco2.1:    
	div $6 $7 		# width-proporcao
	mflo $1
	sll $1 $1 2 		# onde vai percorrer no eixo y
	add $15, $15, $1
	add $8, $8, $1
	sll $16, $13, 2 
	sub $8, $8, $16 	# volta para a coluna inicial
	sub $15, $15, $16 
	add $9, $0, $13 	# valor inicial de colunas
	addi $10, $10, -1 	# linhas
	j laco1.1  
fimlaco1.1: 
	jr $31
	
